				content:
					'<!-- wp:group {"align":"full","style":{"color":{"background":"#f1f1ee","text":"#000000"}}} -->\n<div class="wp-block-group alignfull has-text-color has-background" style="background-color:#f1f1ee;color:#000000;"><div class="wp-block-group__inner-container"><!-- wp:spacer {"height":26} -->\n<div style="height:26px;" aria-hidden="true" class="wp-block-spacer"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:columns {"align":"wide"} -->\n<div class="wp-block-columns alignwide"><!-- wp:column {"width":30} -->\n<div class="wp-block-column" style="flex-basis:30%;"><!-- wp:spacer {"height":20} -->\n<div style="height:20px;" aria-hidden="true" class="wp-block-spacer"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:heading {"level":3,"style":{"typography":{"fontSize":28,"lineHeight":"1.3"}}} -->\n<h3 style="font-size:28px;line-height:1.3;"><strong>What Our Customers Are Saying</strong></h3>\n<!-- /wp:heading --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {"width":70} -->\n<div class="wp-block-column" style="flex-basis:70%;"><!-- wp:spacer {"height":24} -->\n<div style="height:24px;" aria-hidden="true" class="wp-block-spacer"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:jetpack/rating-star {"rating":5,"className":"margin-bottom-half"} -->\n<figure class="wp-block-jetpack-rating-star margin-bottom-half" style="text-align:left;"><span>★</span><span>★</span><span>★</span><span>★</span><span>★</span></figure>\n<!-- /wp:jetpack/rating-star -->\n\n<!-- wp:paragraph {"className":"margin-top-half margin-bottom-half","style":{"typography":{"fontSize":18}}} -->\n<p class="margin-top-half margin-bottom-half" style="font-size:18px;">Reasonably priced good food and drink. The menu favorite that keeps me coming back is the seafood chowder. Really tasty, nice and hot. It\'s perfect for a chilly winter night! Stuff is always very attentive and helpful. I always enjoy and relax with the calm atmosphere.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {"className":"margin-top-half","style":{"typography":{"fontSize":16}}} -->\n<p class="margin-top-half" style="font-size:16px;"><strong>Brianna</strong><br>Brighton</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:spacer {"height":30} -->\n<div style="height:30px;" aria-hidden="true" class="wp-block-spacer"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:jetpack/rating-star {"rating":5,"className":"margin-bottom-half"} -->\n<figure class="wp-block-jetpack-rating-star margin-bottom-half" style="text-align:left;"><span>★</span><span>★</span><span>★</span><span>★</span><span>★</span></figure>\n<!-- /wp:jetpack/rating-star -->\n\n<!-- wp:paragraph {"className":"margin-top-half margin-bottom-half","style":{"typography":{"fontSize":18}}} -->\n<p class="margin-top-half margin-bottom-half" style="font-size:18px;">Great food at a great price! Love the seafood plates as well as the salads. Excellent eating experience from walking in the door and being greeted by stuff, seated and drink order taken, was probably 5 minutes. Server was very helpful and friendly. We\'ll definitely come back!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {"className":"margin-top-half","style":{"typography":{"fontSize":16}}} -->\n<p class="margin-top-half" style="font-size:16px;"><strong>Jayla</strong><br>Hove</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:spacer {"height":30} -->\n<div style="height:30px;" aria-hidden="true" class="wp-block-spacer"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:jetpack/rating-star {"rating":5,"className":"margin-bottom-half"} -->\n<figure class="wp-block-jetpack-rating-star margin-bottom-half" style="text-align:left;"><span>★</span><span>★</span><span>★</span><span>★</span><span>★</span></figure>\n<!-- /wp:jetpack/rating-star -->\n\n<!-- wp:paragraph {"className":"margin-top-half margin-bottom-half","style":{"typography":{"fontSize":18}}} -->\n<p class="margin-top-half margin-bottom-half" style="font-size:18px;">The place is awesome with attending staff. Excellent and authentic flavors. Will surely visit this place again. It also is an excellent place to have a business conversation. We really recommend this restaurant.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {"className":"margin-top-half","style":{"typography":{"fontSize":16}}} -->\n<p class="margin-top-half" style="font-size:16px;"><strong>Ethan</strong><br>Kemp Town</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:spacer -->\n<div style="height:100px;" aria-hidden="true" class="wp-block-spacer"></div>\n<!-- /wp:spacer --></div></div>\n<!-- /wp:group -->',
