				description: '',
				content:
					'<!-- wp:columns {"align":"wide"} -->\n<div class="wp-block-columns alignwide"><!-- wp:column {"verticalAlignment":"top","width":40} -->\n<div class="wp-block-column is-vertically-aligned-top" style="flex-basis:40%;"><!-- wp:heading {"level":3,"className":"margin-top-none","style":{"typography":{"lineHeight":"1.2"}}} -->\n<h3 class="margin-top-none" style="line-height:1.2;"><strong>These are the best pancakes you\'ll ever have</strong></h3>\n<!-- /wp:heading --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class="wp-block-column"><!-- wp:paragraph -->\n<p>When I was younger I loved pancakes. Excuse me, I loved maple syrup. Pancakes were a way to get as much maple syrup on my plate, my hands, and my face. Eventually my mother realized I was leaving the pancakes half-eaten and we’d run out of syrup in two weeks instead of a month. It’s not that my mother’s pancakes were bad, it was that I didn’t know what a pancake tasted like that wasn’t drenched in dark, sweet, syrup.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->',
