				description: '',
				content:
					'<!-- wp:image {"align":"wide","id":233,"sizeSlug":"full"} -->\n<figure class="wp-block-image alignwide size-full"><img src="https://a8ctm1.files.wordpress.com/2020/01/joe-gardner-fn_bt9fwg_e-unsplash.jpg" alt="" class="wp-image-233" /></figure>\n<!-- /wp:image -->\n\n<!-- wp:columns -->\n<div class="wp-block-columns"><!-- wp:column {"width":66.66} -->\n<div class="wp-block-column" style="flex-basis:66.66%;"><!-- wp:paragraph {"style":{"typography":{"fontSize":18}}} -->\n<p style="font-size:18px;">Tell your visitors how to get in touch with you. You could also get a bit more specific, by letting them know what to contact you about. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {"style":{"typography":{"fontSize":18}}} -->\n<p style="font-size:18px;">Be sure to mention all the channels where visitors can reach you, including social media. If you\'d rather not provide your email, you can add a contact form instead.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {"width":33.33} -->\n<div class="wp-block-column" style="flex-basis:33.33%;"><!-- wp:paragraph {"fontSize":"small"} -->\n<p class="has-small-font-size"><strong><span class="uppercase">Drop me a line</span></strong><br><a href="mailto:contact@example.com">contact@example.com</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {"className":"margin-bottom-none","fontSize":"small"} -->\n<p class="margin-bottom-none has-small-font-size"><span class="uppercase"><strong>Let\'s hang out</strong></span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:social-links {"className":"margin-top-half"} -->\n<ul class="wp-block-social-links margin-top-half"><!-- wp:social-link {"url":"","service":"wordpress"} /-->\n\n<!-- wp:social-link {"url":"#","service":"facebook"} /-->\n\n<!-- wp:social-link {"url":"#","service":"twitter"} /-->\n\n<!-- wp:social-link {"url":"#","service":"instagram"} /-->\n\n<!-- wp:social-link {"service":"linkedin"} /-->\n\n<!-- wp:social-link {"url":"#","service":"youtube"} /--></ul>\n<!-- /wp:social-links --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->',
